-- ----------------------------
-- Records of qanda
-- ----------------------------
INSERT INTO `qanda` VALUES ('1', 'gdr的第一个问题', '<pre style=\"line-height:1.3; font-size:14px; background-color: #FFFFFF\">我是南大硕士毕业，当时信心满满找工作，结果我看中的企业没一个要我的。不过说实话我也看不上他们。呵呵！后来本来想读博士，爸妈说支撑不起，我只能<br>被迫去工作，后来找了份工作，还在南京，每个月2417块，190的公积金还有其他杂七杂八的，勉强能过日子，但是3年了工资一直都没涨。我也蛮郁闷的，自己<br>工作挺蛮努力的，为啥工资就是不提呢。大学时候交了个女朋友当时还处的不错，我还用3个月的生活费，给她买了1个IP5。就在我工作1年后，直接跟我说了分<br>手。不过我不伤心，今天终于鼓起勇气交上辞职信，在此立贴宣誓，以后我会在纳斯达克敲钟扇这个社会和她一个大嘴巴子。<br><img src=\"data:image/gif;base64,\" alt=\"\"></pre>', '2014-11-04 15:04:08', '0', 'gdr', '0', '0', '0', '1', '0');
INSERT INTO `qanda` VALUES ('2', null, '<pre style=\"line-height:1.3; font-size:14px; background-color: #FFFFFF\">上市的时候能不能分我一百万哈<br><img src=\"data:image/gif;base64,\" alt=\"\" height=\"177\" width=\"251\"></pre>', '2014-11-04 15:07:49', '0', 'gdr', '0', '1', '0', '0', '0');
INSERT INTO `qanda` VALUES ('3', 'gdr的第二个问题', '<pre style=\"line-height:1.3; font-size:14px; background-color: #FFFFFF\">相识六年短信说要分手，我只希望他能亲口向我说要分手，最好解释一下分手的原因，但是没有等到。\n绝望之后，发信息给对方说不用再解释了，我放手了。对方竟然就回：谢谢。\n（谁能告诉我，谢谢是什么意思？）<br><img src=\"data:image/jpeg;base64,\" alt=\"\" height=\"193\" width=\"357\"></pre>', '2014-11-04 15:21:08', '0', 'gdr', '0', '0', '0', '1', '4');
INSERT INTO `qanda` VALUES ('4', null, '<pre style=\"line-height:1.3; font-size:14px; background-color: #FFFFFF\">可算是了了这段烦人的吊感情，终于清净了，万分感谢。<br>参见大话西游，孙悟空对唐僧，嗡嗡嗡嗡。。。。。</pre>', '2014-11-04 15:21:53', '0', 'gdr', '0', '3', '0', '0', '0');
INSERT INTO `qanda` VALUES ('5', null, '<pre style=\"line-height:1.3; font-size:14px; background-color: #FFFFFF\">女生找同龄男子的话，一定要早结婚，越拖变数越大。<br>在他一无所有的时候都不愿意娶你，你还打算他功成名就来娶你吗？</pre>', '2014-11-04 15:23:14', '0', 'gbc', '0', '3', '0', '0', '0');
INSERT INTO `qanda` VALUES ('6', null, '<pre style=\"line-height:1.3; font-size:14px; background-color: #FFFFFF\">谢谢，不需要组织出一个不伤害你，不伤害自己，不伤害曾经，不伤害未来的理由，大概就\n是，爱过…<br><img src=\"data:image/jpeg;base64,\" alt=\"\"></pre>', '2014-11-04 15:24:14', '0', 'gbc', '0', '3', '0', '0', '0');

